const updatePassword = (req, res) => {
    User.findOne({ "uporabniskoIme": globUsername })
        .exec((napaka, uporabnikovoGeslo) => {

            var staroGeslo = req.body.staro_geslo_input_field;

            if (staroGeslo === uporabnikovoGeslo.geslo) {

                if (req.body.novo_geslo_prvic_input_field === req.body.novo_geslo_drugic_input_field) {

                    uporabnikovoGeslo.geslo = req.body.novo_geslo_prvic_input_field;

                }
            }

            uporabnikovoGeslo.save((napaka, uporabnikovoGeslo) => {
                if (napaka) {
                    res.status(404).json(napaka);
                } else {
                    res.status(200).redirect('/my_profile')
                }
            });
        });
};

