const createRecipe = (req, res) => {

    Recipe.create(
        {
            userID: req.body.userID,
            name: req.body.name,
            description: req.body.description,
            img: req.body.img,
            preparation: req.body.preparation,
            cooking: req.body.cooking,
            instructions: req.body.instructions,
            ingredients:
            {
                ingredientsList: req.body.ingredients.ingredientsList,
            },
            calories:
            {
                servings: req.body.calories.servings,
                calories: req.body.calories.calories
            }
        }, (err, recipe) => {
            if (err) {
                console.error(err);
                res.status(400).json("Napaka: " + err);
            } else {
                res.status(200).json(recipe._id.toString());
            }
        }
    );
};

