            if (opis.length != 0) {
                recept.description = opis;
            }

            var preparation = req.body.preparation;
            if (preparation.length != 0) {
                recept.preparation = preparation;
            }

            var cooking = req.body.cooking;
            if (cooking.length != 0) {
                recept.cooking = cooking;
            }

            var calories = req.body.calories.calories;
            if (calories.length != 0) {
                recept.calories.calories = calories;
            }
            //recept.find().exec((err, odg) => {console.log(odg)})
